    <g id="btn-gamma" class="la-btn-active-ref la-btn-specter" title-ref="raios gama (γ)" number-ref="Ref. 01" data-ref="São um tipo de radiação eletromagnética formada por fótons altamente energéticos e de alta frequência. Apresentam grande capacidade penetrante, sendo capazes de se propagar a milhares de metros no ar e atravessar chapas de aço com até 15 cm de espessura. Propagam-se no vácuo com a velocidade da luz, cerca de 300.000 km/s.">
        <rect x="213.8" y="69.2" class="st0" width="99.1" height="28.7"/>
    </g>
    <g id="btn-raio-x" class="la-btn-active-ref la-btn-specter" title-ref="Raios X" number-ref="Ref. 02" data-ref="Os raios X são radiações eletromagnéticas de alta frequência, produzidas a partir da colisão de feixes de elétrons com metais. Essa radiação não pode ser percebida pelo olho humano. É importante na medicina porque possibilita gerar diagnósticos por meio de imagens.">
        <rect x="214.5" y="200.2" class="st0" width="89.5" height="28.3"/>
    </g>
    <g id="btn-uv" class="la-btn-active-ref la-btn-specter" title-ref="UV (Ultravioleta)" number-ref="Ref. 03" data-ref="A radiação ultravioleta, ou simplesmente UV, é a mais energética entre aquelas emitidas pelo sol e por isso apresenta mais perigos para diversas formas de vida da superfície terrestre. Ela é
dividida em UV-A, UV-B, UV-C.">
        <rect x="215.5" y="362" class="st0" width="41.1" height="28.5"/>
    </g>
    <g id="btn-infravermelho" class="la-btn-active-ref la-btn-specter" title-ref="Raios Infravermelhos" number-ref="Ref. 04" data-ref="Têm comprimento de onda entre 700 nm e 50.000 nm. É um tipo de radiação de baixa energia, que fica na faixa de energia necessária para fazer os átomos de uma substância vibrarem sem provocar uma reação, portanto, é uma radiação não ionizante. Muito usados em controles remoto e leitores de código de barra.">
        <rect x="214.5" y="1149" class="st0" width="198" height="30"/>
    </g>
    <g id="btn-microondas" class="la-btn-active-ref la-btn-specter" title-ref="Microondas" number-ref="Ref. 05" data-ref="A radiação eletromagnética produzida na região do espectro entre 1 mm e 30 cm é denominada de microonda. Esse tipo de radiação tem grandes aplicações práticas, por exemplo, para aquecer substâncias que são compostas principalmente por água. Um dos seus maiores usos é no forno de microondas.">
        <rect x="214.5" y="1417" class="st0" width="158.5" height="28.6"/>
    </g>
    <g id="btn-radio" class="la-btn-active-ref la-btn-specter" title-ref="Rádio" number-ref="Ref. 06" data-ref="As ondas de rádio (AM e FM) são ondas eletromagnéticas. Fazem parte dos chamados
raios hertzianos, que englobam também os raios da TV. Elas têm comprimento de 3*10<sup>8</sup> nm até 3*10<sup>17</sup> nm, apresentam baixa energia, e sua recepção e transmissão são feitas por antenas.">
        <rect x="214.5" y="1639.7" class="st0" width="84.5" height="30"/>
    </g>
</svg>
